import styled from "styled-components";

const ButtonStyled = styled.a`
  display: flex;
  align-items: center;
  justify-content: space-around;
  border: none;
  border-bottom: 2px solid black;
  width: 100px;
  margin: 0 0.5em;
  font-size: 1.4em;
  font-weight: bold;
  color: #2f3640;
  background-color: transparent;
`;

export default ButtonStyled;
